import React from 'react';
import Header from "../src/components/Header/Header";
import Menu from "../src/components/Menu/Menu";
import SpeakerSearchBar from "../src/components/SpeakerSearchBar/SpeakerSearchBar";
import Speakers from "../src/components/Speakers/Speakers";
import Footer from "../src/components/Footer/Footer";



export default function Pages(){
    const speakers = [
        {
            imgSrc: 'speaker-component-1124.png',
            name: 'Douglas'
        },
        {
            imgSrc: 'speaker-component-1530.png',
            name: 'Tamara'
        },
        {
            imgSrc: 'speaker-component-10803.png',
            name: 'Eugene'
        }
    ];
    return (
        <div>
            <Header/>
            <Menu/>
            <SpeakerContext.Provider value={speakers}>
                <SpeakerSearchBar/>
                <Speakers/>
            </SpeakerContext.Provider>
            <Footer/>
        </div>
    );
}
